script: |
  super -f text -I q295.spq | sort > q295.out

inputs:
  - name: q295.spq
    data: |
      SELECT col2 + + col2 AS col2 FROM tab2 (FORMAT parquet) WHERE - ( + col0 ) NOT BETWEEN 57 AND ( col2 * col2 - col0 );
  - name: tab2

outputs:
  - name: q295.out
    data: |
      116
      46
      80
